SELECT STRING_ESCAPE(@DeeCee, 'JSON');

SELECT DISTINCT
	Test =
		SUBSTRING(
			 value
			,CHARINDEX('\"', value) + 2
			,CHARINDEX('\"', value, CHARINDEX('\"', value) + 1) - CHARINDEX('\"', value) - 2
		)
FROM STRING_SPLIT(STRING_ESCAPE(@DeeCee, 'JSON'), ':')
WHERE CHARINDEX('\"', value) > 0
	AND CHARINDEX('\"', value, CHARINDEX('\"', value) + 1) > 0
;

SELECT *
FROM OPENJSON(@DeeCee) dc
;

SELECT dc.*
FROM OPENJSON(@DeeCee) WITH (
	 Events	nvarchar(max)	'$.events' AS JSON
) dc
;

SELECT e.*
--INTO sandbox.dbo.DC_CMTEvents
FROM OPENJSON(@DeeCee) WITH (
	 Events	nvarchar(max)	'$.events' AS JSON
) dc
CROSS APPLY OPENJSON(dc.Events) WITH (
	 event_type						tinyint			'$.event_type'
	,ts								datetime2(0)	'$.ts'
	,lat							decimal(9, 7)	'$.lat'
	,lon							decimal(9, 6)	'$.lon'
	,speed_kmh						decimal(9, 5)	'$.speed_kmh'
	,[value]						decimal(9, 5)	'$.value'
	,severe							varchar(10)		'$.severe'
	,duration_sec					decimal(9, 5)	'$.duration_sec'
	,speed_delta_kmh				decimal(9, 5)	'$.speed_delta_kmh'
	,duration_for_speed_delta_sec	decimal(9, 5)	'$.duration_for_speed_delta_sec'
	,max_mss						decimal(9, 5)	'$.max_mss'
	,displayed						varchar(6)		'$.displayed'
) e
;

SELECT dc.*
FROM OPENJSON(@DeeCee) WITH (
	 WayPoints	nvarchar(max)	'$.waypoints' AS JSON
) dc
;

SELECT wp.*
--INTO sandbox.dbo.DC_CMTWayPoints
FROM OPENJSON(@DeeCee) WITH (
	 WayPoints	nvarchar(max)	'$.waypoints' AS JSON
) dc
CROSS APPLY OPENJSON(dc.WayPoints) WITH (
	 lat					decimal(9, 7)	'$.lat'
	,lon					decimal(9, 6)	'$.lon'
	,ts						datetime2(0)	'$.ts'
	,avg_moving_speed_kmh	decimal(9, 5)	'$.avg_moving_speed_kmh'
	,max_speed_kmh			decimal(9, 5)	'$.max_speed_kmh'
	,speed_limit_kmh		decimal(9, 5)	'$.speed_limit_kmh'
	,link_id				integer			'$.link_id'
	,speed_limit_kmh_raw	decimal(9, 5)	'$.speed_limit_kmh_raw'
	,display_code_X			smallint		'$.display_code[0]'
	,display_code_Y			bit				'$.display_code[1]'
) wp
;